import React from "react";
import "./RestaurantProfilePages.css";
const demoImg =
  "https://img.delicious.com.au/Ry81lFCS/w1200/del/2017/08/braised-chicken-rosemary-and-chilli-pasta-50928-2.jpg";
const demoFoodImg =
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSj9LB5LddQtJaOcSTPcyxsbc2KwcwDYqwpaQ&usqp=CAU";
const RestaurantProfilePages = () => {
  const isOpen: boolean = false;
  return (
    <div className="RestaurantProfilePages">
      <img className="restaurantPic" src={demoImg} alt="food" />
      <h3>Claro</h3>
      <span>Ran Shmueli</span>
      <div className="restaurantOpenStatus">
        {isOpen ? (
          <>
            <img src="\imges\icons\clock-icon.svg" alt="clock" />
            <span>Open now</span>
          </>
        ) : (
          <>
            <span>Close now</span>
            <span>10:00 - 22:00</span>
          </>
        )}
      </div>
    </div>
  );
};
export default RestaurantProfilePages;
